pub enum Error {

    /// Missing from in envelope
    MissingFrom,

    /// Missing to in envelope
    MissingTo,

    /// Can only be one from in envelope
    TooManyFrom,

    /// Invalid email: missing at
    EmailMissingAt,

    /// Invalid email: missing local part
    EmailMissingLocalPart,

    /// Invalid email: missing domain
    EmailMissingDomain,

    /// Cannot parse filename for attachment
    CannotParseFilename,

    /// IO error
    Io(std::io::Error),

    /// Non-ASCII chars
    NonAsciiChars,
}

pub enum Part {

    /// Single part with content
    ///
    Single(SinglePart),

    /// Multiple parts of content
    ///
    Multi(MultiPart),
}

pub enum MultiPartKind {

    /// Mixed kind to combine unrelated content parts
    ///
    /// For example this kind can be used to mix email message and attachments.
    Mixed,

    /// Alternative kind to join several variants of same email contents.
    ///
    /// That kind is recommended to use for joining plain (text) and rich (HTML) messages into single email message.
    Alternative,

    /// Related kind to mix content and related resources.
    ///
    /// For example, you can include images into HTML content using that.
    Related,

    /// Encrypted kind for encrypted messages
    Encrypted {
        protocol: String,
    },

    /// Signed kind for signed messages
    Signed {
        protocol: String,
        micalg: String,
    },
}

pub enum Error {

    /// Internal client error
    Client(&'static str),

    /// IO error
    Io(io::Error),

    /// JSON serialization error
    JsonSerialization(serde_json::Error),
}

pub enum Error {

    /// Internal client error
    Client(String),

    /// Error parsing UTF8 in response
    Utf8Parsing(FromUtf8Error),

    /// IO error
    Io(io::Error),
}

pub enum Mechanism {

    /// PLAIN authentication mechanism
    /// RFC 4616: https://tools.ietf.org/html/rfc4616
    Plain,

    /// LOGIN authentication mechanism
    /// Obsolete but needed for some providers (like office365)
    /// https://www.ietf.org/archive/id/draft-murchison-sasl-login-00.txt
    Login,

    /// Non-standard XOAUTH2 mechanism
    /// https://developers.google.com/gmail/imap/xoauth2-protocol
    Xoauth2,
}

pub enum Tls {

    /// Insecure connection only (for testing purposes)
    None,

    /// Start with insecure connection and use `STARTTLS` when available
    #[cfg(any(feature = "native-tls", feature = "rustls-tls"))]
    Opportunistic(TlsParameters),

    /// Start with insecure connection and require `STARTTLS`
    #[cfg(any(feature = "native-tls", feature = "rustls-tls"))]
    Required(TlsParameters),

    /// Use TLS wrapped connection
    #[cfg(any(feature = "native-tls", feature = "rustls-tls"))]
    Wrapper(TlsParameters),
}

pub enum Error {

    /// Transient SMTP error, 4xx reply code
    ///
    /// [RFC 5321, section 4.2.1](https://tools.ietf.org/html/rfc5321#section-4.2.1)
    Transient(Response),

    /// Permanent SMTP error, 5xx reply code
    ///
    /// [RFC 5321, section 4.2.1](https://tools.ietf.org/html/rfc5321#section-4.2.1)
    Permanent(Response),

    /// Error parsing a response
    ResponseParsing(&'static str),

    /// Error parsing a base64 string in response
    ChallengeParsing(DecodeError),

    /// Error parsing UTF8in response
    Utf8Parsing(FromUtf8Error),

    /// Internal client error
    Client(&'static str),

    /// DNS resolution error
    Resolution,

    /// IO error
    Io(io::Error),

    /// TLS error
    #[cfg(feature = "native-tls")]
    Tls(native_tls::Error),

    /// Parsing error
    Parsing(nom::error::ErrorKind),

    #[cfg(feature = "r2d2")]
    Pool(r2d2::Error),
}

pub enum ClientId {

    /// A fully-qualified domain name
    Domain(String),

    /// An IPv4 address
    Ipv4(Ipv4Addr),

    /// An IPv6 address
    Ipv6(Ipv6Addr),
}

pub enum Extension {

    /// 8BITMIME keyword
    ///
    /// RFC 6152: https://tools.ietf.org/html/rfc6152
    EightBitMime,

    /// SMTPUTF8 keyword
    ///
    /// RFC 6531: https://tools.ietf.org/html/rfc6531
    SmtpUtfEight,

    /// STARTTLS keyword
    ///
    /// RFC 2487: https://tools.ietf.org/html/rfc2487
    StartTls,

    /// AUTH mechanism
    Authentication(Mechanism),
}

pub enum MailParameter {

    /// `BODY` parameter
    Body(MailBodyParameter),

    /// `SIZE` parameter
    Size(usize),

    /// `SMTPUTF8` parameter
    SmtpUtfEight,

    /// Custom parameter
    Other {
        /// Parameter keyword
        keyword: String,
        /// Parameter value
        value: Option<String>,
    },
}

pub enum RcptParameter {

    /// Custom parameter
    Other {
        /// Parameter keyword
        keyword: String,
        /// Parameter value
        value: Option<String>,
    },
}

pub enum Severity {

    /// 2yx
    PositiveCompletion = ,

    /// 3yz
    PositiveIntermediate = ,

    /// 4yz
    TransientNegativeCompletion = ,

    /// 5yz
    PermanentNegativeCompletion = ,
}

pub enum Category {

    /// x0z
    Syntax = ,

    /// x1z
    Information = ,

    /// x2z
    Connections = ,

    /// x3z
    Unspecified3 = ,

    /// x4z
    Unspecified4 = ,

    /// x5z
    MailSystem = ,
}
